import React, { Fragment, useEffect, useState } from "react";

const URL = "http://localhost:3001/";

function ListServers()
{
	const [servers, setServers] = useState([]);

	const getServers = async() => {
		try {
			const response = await fetch(URL + "get");
			const data = await response.json();

			setServers(data);
		} catch (err) { console.error(err.message); }
	}

	useEffect(() => {
		getServers();
	}, []);

	return (
		<Fragment>
			<table className="table mt-5 text-center">
				<thead>
					<tr>
						<th>Name</th>
						<th>IP</th>
						<th>Time Running</th>
						<th>Type</th>
						<th>Price So Far</th>

						<th>Edit</th>
						<th>delete</th>
					</tr>
				</thead>
				<tbody>
					{
						servers.map(server => (
							<tr>
								<td>{server._Name}</td>
								<td>{server._IP}</td>
								<td>{server._TimeRunning}</td>
								<td>{server._TypeName}</td>
								<td>{server._TypePPM}</td>
								<td>Edit</td>
								<td>Delete</td>
							</tr>
						))
					}
				</tbody>
			</table>
		</Fragment>
	);
}

export default ListServers;
